import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import FuntionComponent from './components/user/userLogin';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/hello' element={<FuntionComponent/>}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
